import React, { useContext } from "react";
import { Grid, Typography, Avatar, Button } from "@material-ui/core";
import { useHistory } from "react-router-dom";
import GlobalStateContext from "../../Global/GlobalStateContext";
import WelcomeBallon from "../../Components/DashboardPage/WelcomeBallon";

import { useStyles } from "./style";

export default function DashboardPage() {
  const classes = useStyles();
  return (
    <Grid container className={classes.gridContainer}>
      <Grid item xs={12} className={classes.header}>
        <Typography variant="body1" component="p" className={classes.titulo}>
          Bem vindo!
        </Typography>
      </Grid>
      <Grid item xs={1} className={classes.gridAvatar}>
        <Avatar className={classes.large} alt="Remy Sharp" />
      </Grid>
      <Grid item xs={11} className={classes.content}>
        <Grid container>
          <Grid item xs={12} sm={7}>
            <WelcomeBallon />
          </Grid>
          <Grid item xs={12}>
            <Button classeName={classes.button}>Vagas disponíveis</Button>
            <Button classeName={classes.button}>Trilhas de conteúdo</Button>
            <Button classeName={classes.button}>Minhas candidaturas</Button>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}
